import React from "react";
import { Box, Button, TextField, Typography, Card, CardContent } from "@mui/material";
import FavoriteIcon from "@mui/icons-material/Favorite";
import { useNavigate } from "react-router-dom";

export default function Signup() {
  const navigate = useNavigate();

  const handleContinue = () => {
    navigate("/predict");
  };

  return (
    <Box
      sx={{
        minHeight: "100vh",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        background: "linear-gradient(135deg, #f9d3e1, #f8a1c4)",
      }}
    >
      <Card sx={{ p: 4, borderRadius: 4, boxShadow: 4, width: 380, textAlign: "center" }}>
        <FavoriteIcon sx={{ color: "#e91e63", fontSize: 48 }} />
        <Typography variant="h5" fontWeight="bold" gutterBottom>
          Welcome to Hridamrit ðŸ’–
        </Typography>
        <Typography variant="body2" color="text.secondary" mb={2}>
          Start your heart wellness journey today.
        </Typography>

        <CardContent>
          <TextField fullWidth label="Name" variant="outlined" sx={{ mb: 2 }} />
          <TextField fullWidth label="Email" variant="outlined" sx={{ mb: 2 }} />
          <TextField fullWidth label="Password" type="password" variant="outlined" sx={{ mb: 3 }} />
          <Button
            variant="contained"
            color="secondary"
            fullWidth
            sx={{ py: 1.2, borderRadius: 2 }}
            onClick={handleContinue}
          >
            Continue to Prediction
          </Button>
        </CardContent>
      </Card>
    </Box>
  );
}
